import React,{Component} from 'react';
import TopNavLeftIcons from './TopNavLeftIcons';


class TopNavLeft extends Component {
     
    render() {
        return (
            <div>
                <TopNavLeftIcons icon ='fab fa-facebook-f'/>
                <TopNavLeftIcons icon ='fab fa-google-plus-g'/>
                <TopNavLeftIcons icon ='fab fa-twitter'/>
                <TopNavLeftIcons icon ='fab fa-linkedin-in'/>
                <TopNavLeftIcons icon ='fab fa-instagram'/>
            </div>
        )
    };
}
export default TopNavLeft;
